import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";

export default function Expenses(props) {
  const items = props.items;
  const year1 = props.year;
  return (
    <Card className="expenses">
      {items
        .filter((ele) => ele.date.getFullYear() == year1) //Vi sao ko phai la ===?
        .map((element) => {
          return (
            <ExpenseItem
              title={element.title}
              date={element.date}
              amount={element.amount}
            ></ExpenseItem>
          );
        })}
    </Card>
  );
}
